const std::vector<int32_t> match(const IRConditionerConf conf) {
  if (auto search = code_hub.find(conf); search != code_hub.end()) {
    ESP_LOGD(TAG, "Has code!");

    // convert PROGMEM into memory
    const IRConditionerCode &conditioner_code = code_hub.at(conf);
    const int32_t *code_p = conditioner_code.code; // PROGMEM

    int32_t *code = new int32_t[length];
    memcpy_P(code, code_p, sizeof(int32_t) * length);

    std::vector<int32_t> _code;

    _code.assign(code, code + length);

    delete[] code;

    return _code;
  } else {
    return turn_off_code;
  }
};

const std::vector<int32_t> match(const climate::ClimateMode mode,
                                 const climate::ClimateFanMode fan_mode,
                                 const int target_temperature) {
  return match({mode, fan_mode, target_temperature});
}

